import styled from "styled-components";

export const ContributionBox = styled.ul`
  display: flex;
  width: 100%;
  height: 8rem;
  flex-direction: column;
  flex-wrap: wrap;
  /* border: 0.3px gray solid; */
  margin-top: 2rem;
  align-items: center;

  li {
    display: inline-block;
    width: 0.6rem;
    height: 0.6rem;
    margin: 2px;
    border: 0.2px solid black;
    background-color: blue;
  }
`;
